        const statusEl = document.getElementById('status');
        const visEl = document.getElementById('vis');

        // Mobile-only spec tweaks: legend placement + title sizing/padding.
        // Desktop stays as-is.
        try {
            const isMobile = window.matchMedia && window.matchMedia('(max-width: 640px)').matches;
            if (isMobile && spec) {
                spec.config = spec.config || {};
                spec.config.legend = {
                    orient: 'bottom',
                    direction: 'horizontal',
                    columns: 2,
                    labelLimit: 120,
                    labelFontSize: 12,
                    symbolSize: 120,
                    padding: 6,
                    ...spec.config.legend,
                };
                spec.config.title = {
                    fontSize: 14,
                    subtitleFontSize: 11,
                    offset: 10,
                    ...spec.config.title,
                };
                spec.padding = { top: 8, left: 6, right: 6, bottom: 6, ...(spec.padding || {}) };
            }
        } catch (e) {
            // Non-fatal: fall back to desktop spec
            console.warn('Mobile spec tweak failed', e);
        }

        try {
            vegaEmbed('#vis', spec, {actions: false, renderer: 'canvas'})
                .then(() => { if (statusEl) statusEl.style.display = 'none'; })
                .catch((err) => {
                    console.error('Vega embed failed', err);
                    if (statusEl) {
                        statusEl.style.display = 'block';
                        statusEl.innerHTML = '<b>Chart failed to render.</b><br/><pre>' + (err && (err.stack || err.message) ? (err.stack || err.message) : String(err)) + '</pre>';
                    }
                    if (visEl) visEl.innerHTML = '';
                });
        } catch (err) {
            console.error('Unexpected error', err);
            if (statusEl) {
                statusEl.style.display = 'block';
                statusEl.innerHTML = '<b>Unexpected error.</b><br/><pre>' + (err && (err.stack || err.message) ? (err.stack || err.message) : String(err)) + '</pre>';
            }
        }
